import React from 'react';

class Header extends React.Component {



    render () {
        const navMenuStyle = {
            color: "red",
            marginLeft: "auto"
        };


        const entireNavStyle = {
            backgroundColor: "white"
        };

        return (
            <div style={entireNavStyle}>
                <div className="container">
                    <div className="row">
                        <div className="col">Test 33</div>
                        <div className="col" style={navMenuStyle}>Test 67</div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Header;
